  activePartId.value = s.activeIndex
}
const slideTo = (index: number) => {
  swiper.value?.slideTo(index)
}
const slideNext = () => {
  swiper.value?.slideNext()
  setTimeout(() => {
    setScrollTo()
  }, 0)
}
const slidePrev = () => {
  swiper.value?.slidePrev()
  setTimeout(() => {
    setScrollTo()
  }, 0)
}
const setScrollTo = () => {
  if (plan.value) {
    const planCoords = plan.value.getBoundingClientRect()
    const activeIndicator = plan.value.querySelector('.indicator.active')
    if (activeIndicator) {
      const indicatorCoords = activeIndicator.getBoundingClientRect()
      if (indicatorCoords.x + indicatorCoords.width > planCoords.width) {
        plan.value.scrollTo({
          top: 0,
          left: planCoords.right,
          behavior: 'smooth',
        })
      }
      if (indicatorCoords.x < 0) {
        plan.value.scrollTo({
          top: 0,
          left: planCoords.left,
          behavior: 'smooth',
        })
      }
    }
  }
  // plan
}

