  'Лестница временная',
  'Монолитный железобетонный ростверк 450х600 мм, по буронабивным сваям',
  'Плита перекрытия толщиной 220 мм, ГОСТ 9561-2016',
  'Профилированный лист С-10, RAL 7024',
]
const openPart = (id: number) => {
  activePartId.value = id
  setTimeout(() => {
    if (content.value) {
      content.value.addEventListener('click', clickContent)
      clickInfo()
    }
  }, 0)
}
function clickContent(e: Event) {
  if (content.value && e.target && !e.target.closest('.indicator')) {
    activePartId.value = null
    content.value.removeEventListener('click', clickContent)
  }
}
const clickInfo = () => {
  if (info.value) {
    info.value.classList.remove('active')
  }
}
onMounted(() => {
  if (info.value) {
    info.value.onclick = clickInfo
  }
})
</script>

